import './App.css';
import { getCountries } from './services/countries';
import { useState, useEffect } from 'react';

function App() {
  const [country, setCountry] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const data = await getCountries();
      setCountry(data);
    };
  }, []);
  return <div className="App"></div>;
}

export default App;
